    "necedah-national-wildlife-refuge-narrative-report-january-february-march-and-april-1952",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Necedah NWR outlines
    Refuge accomplishments from January through April of 1952. The report begins by
    summarizing the weather conditions, water conditions, and food and cover during
    this period. Wildlife- including migratory birds, upland game birds, furbearers,
    predators, rodents, mammals, and raptors- is also covered. The Refuge development
    and maintenance section discusses physical developments and plantings. Resource
    management is outlined; topics include grazing, fur harvesting, and timber removal.
    A progress report on field investigations and applied research is also provided.
    The public relations section of the report describes Refuge visitors, Refuge participation,
    and violations. N-R forms, and photographs are attached.",nt"license_title":
